window.bookSummaryJSON = "<p><b>What do you do when the demon you’re reluctantly obsessed with knows your deepest darkest secret?</b></p> <p>Every. Excruciating. Detail. </p> <p>If you’re smart, you push him away and bury yourself in work. </p> <p>Except that Vas isn’t the kind of guy who’ll allow me to hide from my feelings for long. Even if he did return from the underworld…different.</p> <p>Meanwhile, I’ve been ignoring all my instincts to hide my tech magic. Instead, I’m using it to help Evie and Kyla solve a high-profile kidnapping case. Not only is it the right thing to do, but the reward money will also allow me to make a fresh start.</p> <p>But now, my bar is being targeted by my enemies. And Vas insists on shoving his body between mine and any kind of danger. Even though he has his own vengeance to plan. But by choosing to shield me, Vas may have switched from the hunter...to the hunted. </p> <p>Now it's my turn to protect <i>him</i>. </p> <p><b>If you like K.F Breene, Ilona Andrews, Patricia Briggs, Faith Hunter, Laurell K. Hamilton, Jennifer Estep, Shannon Mayer, Kim Harrison, and Dannika Dark, you’ll love this series.</b></p> <p>Listen to it now.</p>"; 
